@tmobile_cze me vyzval, abych fotkou vykreslil #hezciinternet. Pro me je hezci internet misto, kde se lidi muzou potkavat a seznamovat se a diky nemu se pak potkat i v realnem svete. Tak jako ja s Gogem a dalsima kamaradama, ktere jsem na internetu potkal. 
PS: A jaky je ten vas?#HezciInternet muzete svymi fotkami tvorit i vy a zaroven muzete vyhrat balicek az v hodnote 16 000 Kc: Sledujte @tmobile_cze, sdilejte krasne a napadite fotky toho, co vam dela radost, a pripojte hashtag #HezciInternet. Jednou tydne porotce vybere tu nej! ;)
